class Listlink extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isDisplay: false,
      list: ["1", "2", "3", "4", "5", "6"]
    };
  }

  render() {
    return (
      <div className="sideBar col-2">
        <ul>
          {this.state.list.map((li, i) => (
            <li key={i}>
              <a href="/">{li}</a>
            </li>
          ))}
        </ul>
      </div>
    );
  }
}

export default Listlink;
